import { BrowserRouter, Routes, Route } from 'react-router-dom';
//import { useTranslation, Trans } from 'react-i18next';
import Menubar from './menubar.js'
import Search from './search.js';
import Cataloging from './cataloging.js';
import About from './about.js';

export default function Mainpage() {
//  const { t, i18n } = useTranslation();

  return (
    <div>
        <BrowserRouter>
            <Menubar />
            <Routes>
                <Route path="/" element={<Search />}></Route>
                <Route path="/catalog" element={<Cataloging />}></Route>
                <Route path="/about" element={<About />}></Route>
            </Routes>
        </BrowserRouter>
        <div style={{position:"fixed",height:"100vh",zIndex:"50"}}>
              <div style={{backgroundColor:"yellow",width:"600px",marginLeft:"auto",marginRight:"auto"}}></div>
            </div>
    </div>
  );
}
